import './App.css';
import { createTheme, ThemeProvider } from '@material-ui/core';
import Banner from './components/Banner';

const theme = createTheme({
  typography: {
    fontSize: 1,
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Banner />
    </ThemeProvider>
  );
}

export default App;
